import React, { useState } from 'react'
import '../pages/quiz.css'
import { QuizBank } from './quizBank'
import Logo from '../../assets/images/Logo.jpg'
import Home from '../../assets/images/home.png'

const Quiz = () => {

  var quizBank = QuizBank;
  // console.log('quizBank', quizBank);

  const [showCurrentState, setCurrentState] = useState(0)

  const handleChange = () => {
    setCurrentState()
  }


  return (
    <>
      <section>
        <div className='container'>
          <div className='row'>
            <div className='col ms-10px'>
              <img src={Logo} className='w-25' alt="..." />
              <a href='#'>HOME</a>
              <a href='#'>FOR YOU</a>
              <a href='#'>FOR YOUR BUSINESS</a>
              <a href='#'>CARBON ABSORBING</a>
              <a href='#'>START YOUR AUDIT</a>
              <button className='btn' type='btn'> FIND OUT MORE</button>
            </div>
          </div>
          <div className='row'>
            <div className='col'>

              <img src={Home} className='position-absolute top-50 start-50' alt='home' />

              {quizBank.map(( i,index,  key) => {
                console.log('index', index);

                return (
                  <React.Fragment key={key}>
                    <ul >{showCurrentState === index ?
                      <li><span className='fs-3' >{index.question}</span></li> : null}

                      {index.options && index.options.map((i, key) => {

                        return (

                          <React.Fragment key={key}>
                            <li >
                              <input className="form-check-input mx-1"
                                name="flexRadioDefault"
                                type='radio'
                                value={i.rating}
                                onClick={handleChange}
                              />
                              {i.label && i.label}
                            </li>
                          </React.Fragment>

                        )
                      })}
                    </ul>
                  </React.Fragment>
                )
              })}
            </div>
          </div>
        </div>
      </section >
    </>
  )
}
export default Quiz;
